import { Config } from "../configue";

export default function() {
  const pages = [
    {
      title: 'agTEK',
      htmlBefore: '<i class="material-icons"></i>',
      Role: 2,
      to: '/main'
    },

    {
      title: 'Vaches & Groupes ',
      htmlBefore: '<i class="material-icons"></i>',
      Role: 2,
      to: '/Vaches'
    },
    {
      title: 'Regime & Fooder',
      htmlBefore: '<i class="material-icons"></i>',
      Role: 2,
      to: '/regime'
    },
    {
      title: 'DAC',
      htmlBefore: '<i class="material-icons"></i>',
      Role: 2,
      to: '/DAC'
    },
    {
      title: 'Profile',
      htmlBefore: '<i class="material-icons"></i>',
      Role: 0,
      to: '/Profile'
    },
    {
      title: 'Statistique',
      htmlBefore: '<i class="material-icons"></i>',
      Role: 2,
      to: '/Statistique'
    },
    {
      title: 'Log',
      htmlBefore: '<i class="material-icons"></i>',
      Role: 2,
      to: '/Log'
    },
    {
      title: 'User',
      htmlBefore: '<i class="material-icons"></i>',
      Role: 2,
      to: '/User'
    },
    {
      title: 'Errors',
      htmlBefore: '<i class="material-icons"></i>',
      Role: 2,
      to: '/errors'
    }
  ];

  return pages;
}
